import './App.css';
import React, { useState } from 'react';
import NumberSquare from './components/NumberSquare';


const App = () => {

  const [size, setSize] = useState(0);
  const [array, setArray] = useState([]);


  const generatePrimes = (n) => {
    let a = [],
      counter = 0;

    for (let i = 0; i <= n; i++) a.push(true);

    a[0] = false;
    a[1] = false;

    for (let i = 2; i <= Math.sqrt(n); i++) {
      if (a[i] === true) {
        counter = 0;
        for (let j = i * i; j <= n; j = (i * i) + (counter * i)) {
          a[j] = false;
          counter++;
        }
      }
    }

    return a;
  };

  const start = () => {
    let primes = generatePrimes(size);
    setArray(primes);
  }

  return (
    <div className="App">
      <div className="headers">
        Sieve of Eratosthenes
      </div>
      <div className="inputs">
        <input type="number" value={size} onChange={e => setSize(e.target.value)} placeholder="hello" />
        <button onClick={start}>Generate</button>
      </div>
      <div className="container">
        <div className="body">
          {array.map((value, index) => {
            return (<NumberSquare number={index} prime={value} />)
          })}
        </div>
      </div>


    </div>
  );
}

export default App;
